import React from "react"
import "../index.css"

const Post = ({data}) => {
  return (
    
    <div className="Post">
        <img src={data.image} alt="" />

        <span style={{fontSize: '12px'}}>{data.name} SATHAYE COLLEGE </span>
        <div className="detail">
            <span> {data.desc}</span>
        </div>
    </div>
  
  )
}

export default Post;
